                    <li> 
                      <button className="button_top" >
                          <Link to = "#"  style={{ textDecoration: 'none' }}>
                          Contact
                          </Link>
                      </button>                              
                    </li>
                </ul>
          <br></br>
          Know the weather before you travel :)
          <Cards  /> 
        </div>
    );
  }
}

export default App;
